Imtrat released a bunch of unauthorised but legal (because of loopholes in the german copyright-law, which left, simply said, foreign live-recordings of foreign artists unprotected) recordings of concerts and radio-shows. The series &quot;Live &amp; Alive&quot; included recordings of such different artists as The Who, Whitney Houston, Ozzy Osborne, David Bowie, Madonna, Elvis Presley and many others. After the Imtrat release of &quot;Phil Collins Live USA&quot; Phil Collins&amp;#039; record company Warner Music filed a lawsuit against them, which finaly ended in a change of copyright laws in Germany and other european countries and the disappearence of Imtrat.

